INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, "東山奈央", "獣人族", 44, "人助け、応援", "トゥインクルウィッシュ", 8, 155, 16, "人助けが大好き！　前向き格闘娘", 2, 27, "ヒヨリ", 100101, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "A");
