INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, "大空直美", "エルフ", 40, "鏡で自分を見ること", "ヴァイスフリューゲル　ランドソル支部", 10, 150, 14, "ボクは誰よりも美しい", 15, 10, "ユキ", 100801, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "AB");
