INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, "内田真礼", "獣人族", 42, "空想、ぬいぐるみ集め", "自警団（カォン）", 9, 155, 16, "マホマホ王国のプリンセス", 10, 22, "マホ", 101001, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "O");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, "阿澄佳奈", "ヒューマン", 44, "お裁縫", "ラビリンス", 8, 156, 15, "人懐っこくてマシンガントークな妹系少女", 3, 25, "リノ", 101101, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "A");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, "大橋彩香", "エルフ", 46, "妹と遊ぶこと、二度寝、昼寝、早寝", "フォレスティエ", 12, 156, 17, "みんなのために超能力を使う眠り姫", 6, 24, "ハツネ", 101201, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "A");
