INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, "日高里菜", "獣人族", 21, "かわいいもの集め", "リトルリリカル", 4, 117, 10, "お歌もにんじんも、ウサギさんも大好き♪", 5, 3, "ミミ", 102001, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "O");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, "植田佳奈", "ヒューマン", 40, "観劇、おままごと", "サレンディア救護院", 6, 150, 12, "泣き虫で臆病な守ってあげたい女の子", 9, 9, "クルミ", 102101, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "B");
