INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, "福原綾香", "ヒューマン", 46, "各種楽器", "カルミナ", 6, 163, 17, "人々を守るために歌う、唱喚士の少女", 4, 3, "チカ（クリスマス）", 108401, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "O");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, "植田佳奈", "ヒューマン", 40, "観劇、おままごと", "サレンディア救護院", 6, 150, 12, "泣き虫で臆病な守ってあげたい女の子", 9, 9, "クルミ（クリスマス）", 108501, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "B");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, "芹澤優", "ヒューマン", 38, "屋内でできる遊び", "サレンディア救護院", 5, 148, 14, "ぷうきちといつも一緒！", 9, 10, "アヤネ（クリスマス）", 108601, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "B");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (0, "東山奈央", "獣人族", 44, "人助け、応援", "トゥインクルウィッシュ", 8, 155, 16, "人助けが大好き！　前向き格闘娘", 2, 27, "ヒヨリ（ニューイヤー）", 108701, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "A");
